import Navbar from "../components/Navbar";

export default function Dashboard() {
  return (
    <div>
      <Navbar />
      <div className="p-6">
        <h2 className="text-3xl font-bold">Dashboard</h2>
        <p className="mt-4 text-gray-700">Welcome to your dashboard.</p>
      </div>
    </div>
  );
}
